import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import CardHeader from '@material-ui/core/CardHeader';
import AutoComplete from './AutoComplete.js';
import List from './list.js';

const styles = theme => ({
  card: {
    display: '',
    width: 650,
    margin:25,
    height: 800,
  },
  details: {
    display: 'flex',
    flexDirection: '',
  },
  content: {
    flex: '',
  },
  cover: {
    width: 10,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing.unit,
    paddingBottom: theme.spacing.unit,
  },
});

class CardCase6 extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      value : null,
      m1: this.props.foo,
      x: this.props.foo1,
      index : null,
      titleList: []
    }
    console.log(props.foo1);
  }

  render(){
  const { classes, theme, foo1} = this.props;
  console.log(this.props.foo1)
  return (
    <Card className={classes.card}>
    <CardHeader
           title={'Contact'}
           style={{backgroundColor:'rgb(246,246,246)'}}
     >
     </CardHeader>
      <div className={classes.details}>
        <CardContent className={classes.content}>
        <p><b>Suggestions</b></p>
        <List foo1={this.createTitleList()} onSubmitIndex={this.onSubmitIndex} />
        <Typography component="h15" variant="h15">
            <div className="container_4">
              <p><b>Results</b></p>
              <div id="scroll">{this.printMessage()}</div>
              <p><b>Click to know more:</b></p>
              <div className="c4"><a href={this.printUrl()}>{this.printUrl()}</a></div>
            </div>
        </Typography>
        </CardContent>
      </div>
    </Card>
  );
  }
}

CardCase6.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired,
};

export default withStyles(styles, { withTheme: true })(CardCase6);
